<h2>dataset</h2>

<h3>Description</h3>

<p>The dataset has three columns. The first two columns will be 'Cluster ID' and 'X'(outcome). The third column will be either 'Group Indicator' (for rank-sum tests) or 'Y'(paired outcome for signed-rank tests).
</p>


<h3>Usage</h3>

<pre><code class="language-R">data("dataset")</code></pre>
